import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const RolloverScreen = () => {
  return (
    <View>
      <Text>RolloverScreen</Text>
    </View>
  )
}

export default RolloverScreen

const styles = StyleSheet.create({})
